import React from "react";

function MatchTypeSelector(props) {
  const register = document.querySelector(".register");
  document.getElementById("register")[0].style.display = "none";

  return (
    <div>
      <br />
      <div className="row" style={{ textDecoration: "underline" }}>
        <div className="col-1"></div>
        <div className="col-4">
          <h6 id="register">Register Match</h6>
        </div>
        <div className="col-2"></div>
        <div className="col-4">
          <h6>Match Stats</h6>
        </div>
        <div className="col-1"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
